import React from 'react'
import './tab.css'

export default class Tab extends React.Component{
  render(){
    return(
      <div className='Tab'>
        <div className='tab-box tab-common'>
          <div className='directory high-light'>目录</div>
          <div className='evaluation'>评价(999)</div>
          <div className='recommend'>推荐</div>
        </div>
        <div className='tab-directory'></div>
      </div>
    )
  }
}
